-- GIFTICON

CREATE SEQUENCE gifticon_seq START WITH 1 INCREMENT BY 1;

BEGIN
    FOR i IN 1..1000 LOOP
        DECLARE
            v_customer_id NUMBER := NULL;
            v_product_id NUMBER := ROUND(DBMS_RANDOM.VALUE(1, 1000));
            v_expiration_date DATE := SYSDATE + ROUND(DBMS_RANDOM.VALUE(0, 730));
            v_status NUMBER := CASE ROUND(DBMS_RANDOM.VALUE(0,1)) 
                               WHEN 0 THEN 0 
                               ELSE 0 
                             END;
        BEGIN
            DBMS_OUTPUT.PUT_LINE('Inserting record for Gifticonid: ' || i);
            DBMS_OUTPUT.PUT_LINE('Customerid: ' || v_customer_id);
            DBMS_OUTPUT.PUT_LINE('Productid: ' || v_product_id);
            DBMS_OUTPUT.PUT_LINE('Expirationdate: ' || TO_CHAR(v_expiration_date, 'YYYY-MM-DD'));
            DBMS_OUTPUT.PUT_LINE('Status: ' || v_status);

            VALUES (
                gifticon_seq.NEXTVAL,
                v_customer_id,
                v_product_id,
                v_expiration_date,
                v_status
            );
        END;
    END LOOP;
END;
